import React, { useState } from "react";
import {
  AppBar,
  Typography,
  Toolbar,
  Box,
  Button,
  Tab,
  Tabs,
  second,
} from "@mui/material";
const Header = () => {
  const { value, setvalue } = userState(second);
  return (
    <AppBar
      position="sticky"
      sx={{
        background:
          "linear-gradient(90deg, rgba(2,0,36,1) 0%, rgba(9,9,121,1) 35%, rgba(0,212,255,1) 100%)",
      }}
    >
      <Toolbar>
        <Typography variant="h4"> BlogsApp </Typography>{" "}
        <Box display="flex">
          <Tabs value={value} onChange={(e, val) => setvalue(val)}>
            <Tab label="All Blogs" />
            <Tab label="My Blogs" />
          </Tabs>{" "}
        </Box>{" "}
        <Box display="flex" marginLeft="auto">
          <Button
            variant="contained"
            sx={{
              margin: 1,
              borferRadius: 10,
            }}
            color="warning"
          >
            {" "}
            Login{" "}
          </Button>{" "}
          <Button
            variant="contained"
            sx={{
              margin: 1,
              borferRadius: 10,
            }}
            color="warning"
          >
            {" "}
            Signup{" "}
          </Button>{" "}
          <Button
            variant="contained"
            sx={{
              margin: 1,
              borferRadius: 10,
            }}
            color="warning"
          >
            {" "}
            Logout{" "}
          </Button>{" "}
        </Box>{" "}
      </Toolbar>{" "}
    </AppBar>
  );
};

export default Header;
